package com.operations;

public class Location {
	
	private int locationId;
	private String locationName;
	private String locationCode;
	private String locationCountry;
	private String loactionAirpoteName;
	
	
	public Location() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	public int getLocationId() {
		return locationId;
	}
	public void setLocationId(int locationId) {
		this.locationId = locationId;
	}
	public String getLocationName() {
		return locationName;
	}
	public void setLocationName(String locationName) {
		this.locationName = locationName;
	}
	public String getLocationCode() {
		return locationCode;
	}
	public void setLocationCode(String locationCode) {
		this.locationCode = locationCode;
	}
	public String getLocationCountry() {
		return locationCountry;
	}
	public void setLocationCountry(String locationCountry) {
		this.locationCountry = locationCountry;
	}
	public String getLoactionAirpoteName() {
		return loactionAirpoteName;
	}
	public void setLoactionAirpoteName(String loactionAirpoteName) {
		this.loactionAirpoteName = loactionAirpoteName;
	}
	
	

}
